import React, { Component } from 'react';
import Card from '../components/Card';
class Education extends Component {
    render() {
        return (
            <div className="frontpage">
            <div className="title">
            <h1 className="subtopic">My Education</h1>
            <Card title="M.Tech Software Engineering" where="VIT University" from="July 2017" to="Present"/>
            <Card title="SSLC | HSC" where="Islamiah Higher Secondary School" from="2011" to="2017"/>
            </div>
            </div>
        )
    }
    }
export default Education
